window.bookSummaryJSON = "<p>One strong woman. Four hulking Fae Guardians. Even a dark secret that could destroy the world doesn't stand a chance. </p> <p>Paranormal Detective Eve Carter knows things. She's always had uncanny gut instincts. When a run of supernatural murders take place, Eve thinks she may be the only one who can save her once-idyllic hometown from the dark threat. </p> <p>What she doesn't expect is four sexy Fae warriors to save her from a vampire attack. Or the mysterious bond that she feels with them. </p> <p>Guardians Noah, Tyler, Jacob, and Cole have spent centuries protecting the Fae, so when there is a breach of the veil between the realms, they are ordered to investigate the disturbance. </p> <p>But what they find is shocking. A beautiful woman with the gift of the Fae...and a compelling desire to serve her every need. </p> <p>Contains mature themes.</p>"; 
